import axios from 'axios';

const BASE_URL = 'http://localhost:8080';

export default {
    getOrders() {
        return axios.get(`${BASE_URL}/orders`).then((response) => response.data);
    },
    addOrder(data) {
        return axios.post(`${BASE_URL}/orders`, data).then((response) => response.data);
    },
    deleteOrder(orderId) {
        return axios.delete(`${BASE_URL}/orders/${orderId}`).then((response) => response.data);
    },
    updateOrder(orderId, data) {
        return axios.put(`${BASE_URL}/orders/${orderId}`, data).then((response) => response.data);
    },
    getOrderById(orderId) {
        return axios.get(`${BASE_URL}/orders/${orderId}`).then((response) => response.data);
    },
    getOrdersByUserId(userId) {
        return axios.get(`${BASE_URL}/orders?userId=${userId}`).then((response) => response.data);
    },
};
